import * as React from "react";
import {
  StyleSheet,
  ImageBackground,
  Button,
  Alert,
  Image,
  Pressable,
} from "react-native";

import EditScreenInfo from "../components/EditScreenInfo";
import { Text, View } from "../components/Themed";
import tw from "tailwind-react-native-classnames";

const image = {
  uri:
    "https://i.pinimg.com/originals/ce/54/45/ce5445fdfa0adc66ff02da67a9fbae48.jpg",
};
export default function TabTwoScreen() {
  return (
    <View style={styles.container}>
      <Text style={tw`text-2xl font-semibold `}>Compete To Win New Cards</Text>
      <Image
        style={styles.stretch}
        source={require("@expo/snack-static/react-native-logo.png")}
      />
      <View>

      <Pressable
        onPress={() => Alert.alert("change to navigate")}
        style={({ pressed }) => [
          {
            backgroundColor: pressed ? "rgb(210, 230, 255)" : "#F4FD19",
          },
          styles.wrapperCustom,
        ]}
      >
        <Text style={styles.button}>Play Now</Text>
      </Pressable>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    background: " rgb(255,62,62))",
  },

  title: {
    fontSize: 20,
    fontWeight: "bold",
  },
  separator: {
    marginVertical: 30,
    height: 1,
    width: "80%",
  },
  tit: {
    marginTop: 40,
  },
  stretch: {
    width: 50,
  },
  wrapperCustom: {
    borderRadius: 8,
    padding: "2 6",
    textAlign: "center",
  },
  button: {
    backgroundColor: "#F4FD19",
  },
});
